The simplest form of a handler is any async function that takes a Conn and returns that Conn. This example sets a 200 Ok status and sets a string body. use trillium::Conn;
async fn hello_world(conn: Conn) -> Conn { conn.ok("hello world!")
} With no further modification, we can drop this handler into a trillium server and it will respond to http requests for us. We're using the smol -runtime based server adapter here. pub fn main() { trillium_smol_server::run(hello_world);
} We can also define this as a closure: pub fn main() { trillium_smol_server::run(|conn: trillium::Conn| async move { conn.ok("hello world") });
} This handler will respond to any request at localhost:8080, regardless of path, and it will always send a 200 Ok http status with the specified body of "hello world".

