The trillium router is based on routefinder . This router supports two types of patterns: Untyped params and a single wildcard. Named params are captured in a map-like interface. Any handler can be mounted inside of a Router (including other Routers), allowing entire applications to be mounted on a path, and allowing for sequences to be run on a given route. Any handler mounted inside of a route that includes a * will have the url rewritten to the contents of that star. Alternative routers that are not based on routefinder are a prime opportunity for innovation and exploration. Here's a simple example of an application that responds to a request like http://localhost:8000/greet/earth with "hello earth" and http://localhost:8000/greet/mars with "hello mars" and responds to http://localhost:8000 with "hello everyone" use trillium::Conn;
use trillium_router::{Router, RouterConnExt}; pub fn main() { env_logger::init(); trillium_smol_server::run( Router::new() .get("/", |conn: Conn| async move { conn.ok("hello everyone") }) .get("/hello/:planet", |conn: Conn| async move { let planet = conn.param("planet").unwrap(); let response_body = format!("hello {}", planet); conn.ok(response_body) }), );
}

