Askama is a jinja-based template engine that preprocesses templates at compile time, resulting in efficient and type-safe templates that are compiled into the application binary. We recommend this approach as a default. Here's how it looks: Given the following file in (cargo root)/templates/examples/hello.html, Hello, {{ name }}! use trillium::Conn;
use trillium_askama::{AskamaConnExt, Template}; #[derive(Template)]
#[template(path = "examples/hello.html")]
struct HelloTemplate<'a> { name: &'a str,
} fn main() { trillium_smol_server::run( |conn: Conn| async move { conn.render(HelloTemplate { name: "world" }) }, );
}

