Sessions are a common convention in web frameworks, allowing for a safe and secure way to associate server-side data with a given http client (browser). Trillium's session storage is built on the async-session crate, which allows us to share session stores with tide. Currently, these session stores exist: MemoryStore (reexported as trillium_sessions::MemoryStore) [1] CookieStore (reexported as trillium_sessions::CookieStore) [1] PostgresSessionStore and SqliteSessionStore from async-sqlx-session RedisSessionStore from async-redis-session MongodbSessionStore from async-mongodb-session The memory store and cookie store should be avoided for use in production applications. The memory store will lose all session state on server process restart, and the cookie store makes different security tradeoffs than the database-backed stores. If possible, use a database. ‚ùóThe session handler must be used in conjunction with the cookie handler, and it must run after the cookie handler. This particular interaction is also present in other frameworks, and is due to the fact that regardless of which session store is used, sessions use a secure cookie as a unique identifier. use trillium::{sequence, Conn};
use trillium_sessions::{MemoryStore, SessionConnExt, Sessions}; pub fn main() { env_logger::init(); trillium_smol_server::run(sequence![ trillium_cookies::Cookies, Sessions::new(MemoryStore::new(), b"01234567890123456789012345678901123"), |conn: Conn| async move { let count: usize = conn.session().get("count").unwrap_or_default(); conn.with_session("count", count + 1) .ok(format!("count: {}", count)) } ]);
}

